import Login from '../pages/Login';
import MainPage from '../pages/MainPage';
import Weather from '../pages/Weather';
import Currency from '../pages/Currency';

export const routeNames = {
    LOGIN: '/login',
    MAINPAGE: '/',
    WEATHER: '/weather',
    CURRENCY: '/currency'
};

export const publicRoutes = [
    { path: routeNames.LOGIN, exact: true, element: Login }
];

export const privateRoutes = [
    { path: routeNames.MAINPAGE, exact: true, element: MainPage },
    { path: routeNames.WEATHER, exact: true, element: Weather },
    { path: routeNames.CURRENCY, exact: true, element: Currency }
];
